import { defineComponentStyle } from "@yamada-ui/react"

export const iconStyle = defineComponentStyle({
  base: {
    color: "currentColor",
    display: "inline-block",
    flexShrink: 0,
    fontSize: "1em",
    lineHeight: "1em",
  },
})

export type IconStyle = typeof iconStyle

"use client"

import type { HTMLStyledProps, ThemeProps } from "@yamada-ui/react"
import type { IconStyle } from "./icon.style"
import {
  createComponent,
  useInjectVarsIntoCss,
  useInjectVarsIntoProps,
} from "@yamada-ui/react"
import { iconStyle } from "./icon.style"

export interface IconProps
  extends HTMLStyledProps<"svg">,
    ThemeProps<IconStyle> {}

const {
  component,
  PropsContext: IconPropsContext,
  usePropsContext: useIconPropsContext,
  withContext,
} = createComponent<IconProps, IconStyle>("icon", iconStyle)

export { component, IconPropsContext, useIconPropsContext, withContext }

/**
 * `Icon` is a general icon component that can be used in your projects.
 *
 * @see https://yamada-ui.com/components/icon
 */
export const Icon = withContext("svg")(
  {
    "aria-hidden": true,
    "data-icon": "",
    role: "img",
    verticalAlign: "middle",
  },
  (props) => {
    const css = useInjectVarsIntoCss(props.css, { fontSize: "size" })
    const rest = useInjectVarsIntoProps(props, { fontSize: "size" })

    return { boxSize: "{size}", ...rest, css }
  },
)

"use client"

import type { IconNode } from "lucide-react"
import type { IconProps } from "./icon"
import { Icon as OriginalIcon } from "lucide-react"
import { Icon, withContext } from "./icon"

export interface LucideIconProps extends IconProps {
  /**
   * The icon of the [Lucide lab](https://github.com/lucide-icons/lucide-lab).
   */
  iconNode?: IconNode
}

/**
 * `LucideIcon` is a component for using [Lucide lab](https://github.com/lucide-icons/lucide-lab) icons.
 *
 * @see https://yamada-ui.com/components/icon
 */
export const LucideIcon = withContext<"svg", LucideIconProps>((props) => (
  <Icon as={OriginalIcon} {...props} />
))()
